import React from 'react';
import Dropdown from './Dropdown';

const Header = () => {
    return (
        <header className='header flex flex-row bg-neutral-900 opacity-95 items-baseline'>
            <div className='flex flex-nowrap text-3xl ml-4 p-3 items-baseline'>
                <span className='space-x-8'></span>
                <h1 className="title text-theme-light" id='noah'>noah</h1>
                <h1 className="title text-theme-dark" id='martineau'>martineau</h1>
                <h1 className="title text-neutral-500 text-2xl self-end" id='com'>.com</h1>
                <span className='ml-4'></span>
            </div>
            <nav>
                <ul id='text-nav' style={{ listStyle: 'none' }} className='flex flex-row flex-nowrap text-xl p-2 space-x-8 ml-6 justify-end'>
                    <li><a className='text-neutral-500' href='#home'>Home</a></li>
                    <li><a className='text-neutral-500' href='#about-me'>About</a></li>
                    <li><a className='text-neutral-500' href='#projects'>Projects</a></li>
                </ul>

                <Dropdown />

            </nav>
        </header>
    );
};

export default Header;
